    false,nt"url": null,nt"notes": "This database comprises 28 State agency
    boundaries and point of contact. The Kansas Geological Survey collected legal descriptions
    of the boundaries for various State agencies. The legal descriptions were translated
    into latitude and longitude coordinates using KGS's LEO and Dpoly software. All
    coverages are stored as double-precision, with coordinates in units of feet from
    a projected coordinate space. Note: This data was collected in 1992, boundaries
    and POCs may have changed.",nt"license_title": null,nt"extras": [{ntt"key":
